package com.luv2code.demo;

public class Main {

	
	public static void printItems(int a , int b) {
		for( int i = 0 ; i < a ; i++) {
			System.out.println(i);
		}
		for( int i = 0 ; i < b ; i++) {
			System.out.println(i);
		}
	}
	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		printItems(10, 10);
	}

}
